import React from 'react';

function PricingComp(props) {
    return (
        <>
            <div className = 'card h-100'>
                <h5 className = 'card-title'>{ props.pricingName }</h5>
                <hr />
                <h6 className = "card-subtitle text-muted">{ props.pricingExplain }</h6>
                <p className = "card-text">便宜價: { props.lowPrice }</p>
                <p className = "card-text">合理價: { props.resonablePrice }</p>
                <p className = "card-text">昂貴價: { props.highPrice }</p>
            </div>
        </>
    );
}

export default PricingComp;
